var i = 0;
function test(p, s)
{
    WScript.Echo("*** Test Case " + i++ + " ***");
    WScript.Echo("source:   " + p.toString());
    WScript.Echo("input:    \"" + s + "\"");
    WScript.Echo("p.exec:   ");
    var previousLastIndex = 0;
    var r;
    while ((r = p.exec(s)) != null)
    {
        WScript.Echo("    \"" + r + "\"");
        if (!p.global) { break; }

        // 'lastIndex' can be the same as in the last iteration if it matched empty, so prevent an infinite loop
        if (p.lastIndex === previousLastIndex)
            ++p.lastIndex;
        previousLastIndex = p.lastIndex;
    }
    p.lastIndex = 0;
    WScript.Echo("p.test:   " + p.test(s));
    WScript.Echo("s.search: " + s.search(p));
    WScript.Echo("s.match:  \"" + s.match(p) + "\"");
    WScript.Echo();
}

